def getRandom(length):
    """
    生成指定长度的随机字符串
    :param length: 长度
    :return: 字符串
    """
    digits = '0123456789'
    ascii_letters = 'abcdefghigklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ'
    str_list = [random.choice(digits + ascii_letters) for i in range(length)]
    random_str = ''.join(str_list)
    return random_str


def start_osk():
    """
    启动屏幕键盘
    :return: void
    """
    os.popen("osk")


def md5sum(path):
    """
    计算文件MD5
    :param path: 文件路径
    :return:文件的MD5值
    """
    f = open(path, 'rb')
    m = hashlib.md5()
    # 大文件处理
    while True:
        d = f.read(8096)
        if not d:
            break
        m.update(d)
    ret = m.hexdigest()
    f.close()
    return ret


def hum_convert(value):
    """
    转换单位
    :param value:字节数
    :return:换算后的字符串
    """
    units = ["B", "KB", "MB", "GB", "TB", "PB"]
    size = 1024.0
    for i in range(len(units)):
        if (value / size) < 1:
            return "%.2f%s" % (value, units[i])
        value = value / size

